import modelA from '../images/swift.jpg';
import modelB from '../images/wagonR.jpg';
import modelC from '../images/innova.jpg';
import modelD from '../images/i10.jpg';
import modelE from '../images/yaris.jpg';

const carModels = [
  { name: '', description: 'Description for Car Model A', image: modelA },
  { name: '', description: 'Description for Car Model B', image: modelB },
  { name: '', description: 'Description for Car Model C', image: modelC },
  { name: 'i10', description: 'Description for Car Model D', image: modelD },
  { name: 'yaris', description: 'Description for Car Model E', image: modelE },
];

const CarModels = () => {
  return (
    <div className="car-models-page">
      <h2>Car Models</h2>
      <div className="car-models-list">
        {carModels.map((car, index) => (
          <div key={index} className="car-model">
            <img src={car.image} alt={car.name} className="car-model-image" />
            <h3>{car.name}</h3>
            <p>{car.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CarModels;
